import Link from 'next/link';

const Navigation = () => (
    <nav className="navigation">
        <Link href="/opdracht">
            <a>Opdracht</a>
        </Link>
        <Link href="/probleemstelling">
            <a>Probleemstelling</a>
        </Link>
        <Link href="/oplossing">
            <a>Oplossing</a>
        </Link>
    </nav>
  );

  export default Navigation;
